<template>
  <el-container class="canvas">
    <transition name="el-fade-in-linear">
      <div v-show="videoDisplay" class="transition-box">
        <video preload="auto" id="video" src="http://m.chint.com/minisite/c-world/2019Newyear/newyear.mp4" webkit-playsinline='true' playsinline='true' x-webkit-airplay='true' x5-video-player-type='h5' x5-video-player-fullscreen='true' x5-video-ignore-metadata='true'  width='100%' height='100%' style="object-fit: fill;"></video>
        <div v-if="buttonDisplay" class="play" @click="play()"></div>
      </div>
    </transition>
    <el-main v-if="formDisplay">
      <div style="height: 53%; width: 100%;">
        <!-- <d-player @play="play" ref="player"></d-player> -->
      </div>
      <el-row>
        <el-col :span="2" :offset="6">
          <span class="label">祝</span>
        </el-col>
        <el-col :span="5">
          <el-input class="el-input-transparent" :maxlength="6" v-model="form.to" placeholder="姓名"></el-input>
        </el-col>
      </el-row>
      <el-row>
        <el-col :span="12" :offset="6">
          <el-input class="el-input-transparent" :maxlength="10" v-model="form.inputA" placeholder="祝福语"></el-input>
        </el-col>
      </el-row>
      <el-row v-if="false">
        <el-col :span="12" :offset="6">
          <el-input class="el-input-transparent" :maxlength="10" v-model="form.inputB" placeholder="祝福语"></el-input>
        </el-col>
      </el-row>
      <el-row>
        <el-col :span="6" :offset="12">
          <el-input class="el-input-transparent el-input-transparent-right" :maxlength="6" v-model="form.from" placeholder="姓名"></el-input>
        </el-col>
      </el-row>
      <el-row class="el-row-button" style="text-align: right;">
        <el-col :span="12" :offset="6">
          <el-button @click="preview">预览</el-button>
        </el-col>
      </el-row>
    </el-main>
  </el-container>
</template>

<script>
  import {
    Container
  } from 'element-ui'
  import VueDPlayer from 'vue-dplayer'
  import html2canvas from 'html2canvas';

  export default {
    name: 'index',
    components: {
      Container,
      'd-player': VueDPlayer
    },
    data () {
      return {
        form: {
          to: '',
          inputA: '',
          inputB: '',
          from: ''
        },
        videoDisplay: false,
        formDisplay: false,
        buttonDisplay: true,
        video: {
         url: 'http://m.chint.com/minisite/c-world/2019Newyear/newyear.mp4',
         pic: '',
         type: 'mp4'
        },
      }
    },
    mounted () {
      let that = this
      that.videoDisplay = true

      let video = document.getElementById('video');

      let ua = navigator.userAgent
      //使用事件监听方式捕捉事件
      video.addEventListener("loaded", function(){
        if (ua.indexOf("iPhone") > 0) {
          video.play()
        } else {
          video.play()
        }
      }, false);
      document.addEventListener("WeixinJSBridgeReady", function () {
        if (ua.indexOf("iPhone") > 0) {
          video.play()
        } else {
          video.play()
        }
      }, false);
      //使用事件监听方式捕捉事件
      video.addEventListener("ended", function(){
        that.videoDisplay = false
        that.formDisplay = true
      }, false);
    },
    created () {
      if (Object.keys(this.$store.state.bless).length == 0) {
        // this.$router.push({name: 'index'})
      } else {
        this.form = this.$store.state.bless
      }
      // this.videoDisplay = true
      // this.videoDisplay = false
      // this.formDisplay = true
    },
    methods: {
      play() {
        let video = document.getElementById('video');
        video.play()
        this.buttonDisplay = false
      },
      preview () {
        if (!this.form.from || (!this.form.inputA && !this.form.inputB) || !this.form.to) {
          alert('信息未填写完整')
          return false
        }
        this.$store.state.bless = this.form
        this.$router.replace({name: 'preview'})
      }
    }
  }
</script>

